export function calculateTimeDelay(length: number) {
    let timeDelay: number;
    switch (true) {
        case length <= 25:
            timeDelay = 80;
            break;
        case length <= 45:
            timeDelay = 40;
            break;
        case length <= 65:
            timeDelay = 20;
            break;
        case length <= 85:
            timeDelay = 2;
            break;
        default:
            timeDelay = 1;
            break;
    }
    return timeDelay;
}
